import React from 'react';
import logo from './logo.svg';
import './App.css';
import Catalog from './Catalog';

class App extends Component{
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title"> Te Catalog App</h1>
        </header>
        <Catalog />
      </div>
    );
  }
}

export default App;
